import React from 'react'
import {Droppable, DragDropContext, Draggable} from 'react-beautiful-dnd'
function Test() {

    const data1 = [1,2,3]
    const data2 = [4,5,6]

    return (
        <div>
            <DragDropContext>
                <Droppable droppableId = 'characters'  >
                    {(provided) => (
                        <ul>
                            {data1.map( (item, i) => <Draggable key = {i} draggableId = {i} index = {i} > <li>{item}</li></Draggable>)}
                        </ul>
                    )}
 
                </Droppable>
            </DragDropContext>
        </div>
    )
}

export default Test
